import React, { useEffect, useState } from 'react';
import { Table, Space, Spin } from 'antd';
import { fetchBooks } from '../services/api';

const BookTable = () => {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchData = async () => {
            setLoading(true);
            try {
                const result = await fetchBooks();
                setData(result);
            } catch (error) {
                console.error('Error fetching book data:', error);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    const columns = [
        { title: 'Ratings Average', dataIndex: 'ratings_average', key: 'ratings_average' },
        { title: 'Author Name', dataIndex: 'author_name', key: 'author_name' },
        { title: 'Title', dataIndex: 'title', key: 'title' },
        { title: 'First Publish Year', dataIndex: 'first_publish_year', key: 'first_publish_year' },
        { title: 'Subject', dataIndex: 'subject', key: 'subject' },
        { title: 'Author Birth Date', dataIndex: 'author_birth_date', key: 'author_birth_date' },
        { title: 'Author Top Work', dataIndex: 'author_top_work', key: 'author_top_work' },
    ];

    if (loading) {
        return <Spin />;
    }

    return (
        <Table dataSource={data} columns={columns} pagination={{ pageSize: 10 }} loading={loading} />
    );
};

export default BookTable;
